function abrirModalImprimir() {
	if (dadosDatasetXML === null) {
		FLUIGC.toast({
			title: 'Atenção!',
			message: 'É necessário realizar uma pesquisa antes de imprimir um relatório.',
			type: 'danger'
		});
	} else {
		const filtrosPreenchidos = [];
		const atividade = $('#atividade').val();
		const noPrazo = $('#noPrazo').val();
		const demanda = $('#demanda').val();
		const antecipacao = $('#antecipacao')[0].checked;
		const naPorta = $('#naPorta')[0].checked;
		const emAndamento = $('#emAndamento')[0].checked;
		const contabil = $('#contabil')[0].checked;
		const fornecedor = $('#fornecedor').val();
		const responsavel = $('#responsavel').val();

		// Cria as constraints de acordo com os valores
		if (atividade != '') {
			filtrosPreenchidos.push('<option value="atividade">Atividade</option>');
		}
		if (noPrazo != '') {
			filtrosPreenchidos.push('<option value="noPrazo">No Prazo</option>');
		}
		if (demanda != '') {
			filtrosPreenchidos.push('<option value="demanda">Tipo de Demanda</option>');
		}
		if (antecipacao || naPorta) {
			filtrosPreenchidos.push('<option value="tipoSolicitacao">Tipo de Solicitação</option>');
		}
		if (emAndamento || contabil) {
			filtrosPreenchidos.push('<option value="status">Status</option>');
		}
		if (fornecedor != '') {
			filtrosPreenchidos.push('<option value="fornecedor">Fornecedor</option>');
		}
		if (responsavel != '') {
			filtrosPreenchidos.push('<option value="responsavel">Responsável</option>');
		}

		const dados = {
			'filtrosPreenchidos': filtrosPreenchidos
		};
		const html = $('.modalImprimir').html();
		const template = Mustache.render(html, dados);

		FLUIGC.modal({
			title: 'Imprimir',
			content: template,
			id: 'modalImprimir',
			size: 'larger',
			actions: [{
				'label': 'Baixar',
				'bind': 'data-baixar-pdf'
			}, {
				'label': 'Visualizar',
				'bind': 'data-visualizar-pdf',
				'classType': 'btn-info'
			}, {
				'label': 'Cancelar',
				'autoClose': true
			}]
		});

		$('[data-baixar-pdf]').on('click', function () {
			const pdf = verificaDadosModal();
			pdfMake.createPdf(pdf).download('relatorio.pdf');
			// String com data e hora: Ex.: "relatorio_02-07-2019_11-45-55.pdf"
			//'relatorio_' + new Date().toLocaleDateString().replaceAll('/', '-') + '_' + new Date().toLocaleTimeString().replaceAll(':','-') + '.pdf'
		});

		$('[data-visualizar-pdf]').on('click', function () {
			const pdf = verificaDadosModal();
			pdfMake.createPdf(pdf).open();
		});

		$('#ordenarPorFiltro').on('change', function () {
			if ($(this).val() == 'Sim') {
				if (filtrosPreenchidos.length > 0)
					$('#campoFiltroOrdenacao').show();
				else
					FLUIGC.toast({
						title: 'Atenção!',
						message: 'Nenhum filtro utilizado.',
						type: 'warning'
					});
			} else {
				$('#filtroOrdenacao').val('');
				$('#campoFiltroOrdenacao').hide();
			}
		});
	}
}

function verificaDadosModal() {
	const ordenarPorFiltro = $('#ordenarPorFiltro').val();
	if (ordenarPorFiltro == 'Sim') {
		const filtroOrdenacaoElemento = $('#filtroOrdenacao');
		let chaveFiltro = null;
		let nomeFiltro = null;
		chaveFiltro = filtroOrdenacaoElemento.val();

		if (isEmpty(chaveFiltro))
			return FLUIGC.toast({
				title: 'Atenção!',
				message: 'É necessário escolher um filtro agrupador.',
				type: 'warning'
			});

		nomeFiltro = filtroOrdenacaoElemento.find('[value=' + chaveFiltro + ']').html();
		return criarPdf(chaveFiltro, nomeFiltro);
	} else
		return criarPdf();
}

function criarArrayTitulosResultados(titulos) {
	const resultado = [];

	titulos.forEach(titulo => {
		resultado.push({
			text: titulo,
			bold: true,
			color: '#FFF',
			margin: [1, 0]
		});
	});

	return resultado;
}

function criarTabelaTipoFiltro(nome, valor) {
	return {
		layout: 'lightHorizontalLines',
		margin: [0, 20, 0, 0],
		table: {
			dontBreakRows: true,
			widths: '*',
			headerRows: 1,
			body: [
				[{
					text: nome,
					bold: true,
				}],
				[valor]
			]
		}
	}
}

function criarTabelaResultados(dados) {
	const headerTotais = criarArrayTitulosResultados(['\nID', '\nSolicitação', '\nDemanda', '\nData Início', '\nResponsável', '\nFornecedor', '\nAtividade', 'No Prazo', 'Em Andamento', 'Data Conclusão', '\nContábil']);
	const tabela = {
		layout: {
			// lightHorizontalLines:
			hLineWidth: (i, node) => {
				if (i === 0 || i === node.table.body.length) return 0;
				return (i === node.table.headerRows) ? 2 : 1;
			},
			vLineWidth: (i) => {
				return 0;
			},
			hLineColor: (i) => {
				return i === 1 ? '#000' : '#AAA';
			},
			paddingLeft: (i) => {
				return i === 0 ? 0 : 8;
			},
			paddingRight: (i, node) => {
				return (i === node.table.widths.length - 1) ? 0 : 8;
			},
			// zebra style com linha de cabeçalho na cor preta:
			fillColor: (i) => {
				if (i === 0)
					return '#000';
				return (i % 2 === 0) ? '#DDD' : null;
			}
		},
		margin: [0, 5, 0, 0],
		style: 'tableCell',
		table: {
			dontBreakRows: true,
			//widths: [12,38,40,38,42,40,38,30,39,38,30],
			widths: ['5%', '11%', '9%', '10%', '*', '11%', '9%', '6%', '*', '10%', '9%'],
			body: [
				[...headerTotais],
			]
		},
	}

	dados.forEach(dado => {
		tabela.table.body.push([dado.solicitacao, dado.tipoSolicitacao, dado.tipoDemanda, dado.dataInicio, dado.responsavel, dado.fornecedor, dado.atividade, dado.noPrazo, dado.emAndamento, dado.dataConclusao, dado.contabil]);
	});

	return tabela;
}

function criarCelulaPainelFiltro(campo, valor) {
	return [{
		text: campo,
		bold: true
	}, {
		text: valor,
		margin: [0, 0, 0, 5]
	}];
}

function criarPdf(chaveFiltro = null, nomeFiltro = null) {
	const atividades = $('#atividade').val();
	const noPrazo = $('#noPrazo').val();
	const tiposDemanda = $('#demanda').val();
	const tiposSolicitacao = [];
	const antecipacao = $('#antecipacao')[0].checked;
	const naPorta = $('#naPorta')[0].checked;
	const status = [];
	const emAndamento = $('#emAndamento')[0].checked;
	const contabil = $('#contabil')[0].checked;
	const fornecedores = $('#fornecedor').val();
	const responsaveis = $('#responsavel').val();
	const dados = dadosDatasetXML;
	const filtros = [
		[],
		[]
	];

	let dataInicio = $('#dataInicio').val();
	let dataConclusao = $('#dataConclusao').val();
	let organizarPorFiltro = null;
	let qtdFiltros = 0;
	let label = '';
	let textoPainelSolicitacao = 'Quantidade de solicitações: ' + dados.length + '.\nEmitido em ' + new Date().toLocaleDateString();

	if (emAndamento)
		status.push('Em andamento');
	if (contabil)
		status.push('Finalizado');
	if (antecipacao)
		tiposSolicitacao.push('Antecipação NF');
	if (naPorta)
		tiposSolicitacao.push('Na porta');
	if (!isEmpty(chaveFiltro) && !isEmpty(nomeFiltro)) {
		organizarPorFiltro = {};
		organizarPorFiltro['chave'] = chaveFiltro;
		organizarPorFiltro['nome'] = nomeFiltro;
		if (chaveFiltro != 'status' && chaveFiltro != 'tipoSolicitacao') {
			organizarPorFiltro['valores'] = $('#' + chaveFiltro).val().split(',');
		} else if (chaveFiltro == 'status') {
			organizarPorFiltro['valores'] = status;
		} else if (chaveFiltro == 'tipoSolicitacao') {
			organizarPorFiltro['valores'] = tiposSolicitacao;
		}
	}

	if (!isEmpty(atividades)) {
		label = atividades.indexOf(',') == -1 ? 'Atividade' : 'Atividades';
		filtros[(qtdFiltros < 5 ? 0 : 1)].push(criarCelulaPainelFiltro(label, atividades.replace(new RegExp(',', 'g'), ', ')));
		qtdFiltros++;
	}
	if (!isEmpty(noPrazo)) {
		filtros[(qtdFiltros < 5 ? 0 : 1)].push(criarCelulaPainelFiltro('No Prazo', noPrazo));
		qtdFiltros++;
	}
	if (!isEmpty(tiposDemanda)) {
		label = tiposDemanda.indexOf(',') == -1 ? 'Tipo de Demanda' : 'Tipos de Demanda';
		filtros[(qtdFiltros < 5 ? 0 : 1)].push(criarCelulaPainelFiltro(label, tiposDemanda.replace(new RegExp(',', 'g'), ', ')));
		qtdFiltros++;
	}
	if (!isEmpty(dataInicio)) {
		dataInicio = converterDataParaBr(dataInicio);
		filtros[(qtdFiltros < 5 ? 0 : 1)].push(criarCelulaPainelFiltro('Data Início', dataInicio));
		textoPainelSolicitacao += ', relativo a período a partir de ' + dataInicio;
		qtdFiltros++;
	}
	if (!isEmpty(dataConclusao)) {
		dataConclusao = converterDataParaBr(dataConclusao);
		filtros[(qtdFiltros < 5 ? 0 : 1)].push(criarCelulaPainelFiltro('Data Conclusão', dataConclusao));
		if (isEmpty(dataInicio)) {
			textoPainelSolicitacao += ', relativo a período';
		}
		textoPainelSolicitacao += ' até ' + dataConclusao;
		qtdFiltros++;
	}
	if (!isEmpty(tiposSolicitacao)) {
		label = tiposSolicitacao.indexOf(',') == -1 ? 'Tipo de Solicitação' : 'Tipos de Solicitação';
		filtros[(qtdFiltros < 5 ? 0 : 1)].push(criarCelulaPainelFiltro(label, tiposSolicitacao));
		qtdFiltros++;
	}
	if (!isEmpty(status)) {
		filtros[(qtdFiltros < 5 ? 0 : 1)].push(criarCelulaPainelFiltro('Status', status));
		qtdFiltros++;
	}
	if (!isEmpty(fornecedores)) {
		label = fornecedores.indexOf(',') == -1 ? 'Fornecedor' : 'Fornecedores';
		filtros[(qtdFiltros < 5 ? 0 : 1)].push(criarCelulaPainelFiltro(label, fornecedores.replace(new RegExp(',', 'g'), ', ')));
		qtdFiltros++;
	}
	if (!isEmpty(responsaveis)) {
		label = responsaveis.indexOf(',') == -1 ? 'Responsável' : 'Responsáveis';
		filtros[(qtdFiltros < 5 ? 0 : 1)].push(criarCelulaPainelFiltro(label, responsaveis.replace(new RegExp(',', 'g'), ', ')));
		qtdFiltros++;
	}

	if (qtdFiltros === 0)
		filtros[0].push('Nenhum filtro utilizado.');

	textoPainelSolicitacao += '.';

	const pdf = {
		info: {
			title: 'Relatório de Atendimento',
			author: top.WCMAPI.user,
			creator: 'fluig',
			creationDate: new Date().toLocaleString(),
		},
		pageSize: 'A4',
		pageMargins: [40, 110, 40, 80],
		footer: (currentPage, pageCount) => {
			return {
				text: currentPage.toString() + ' de ' + pageCount,
				margin: 40
			};
		},
		background: () => {
			return {
				image: getLogoBackgroundBase64(),
				opacity: 0.05,
				width: 1500,
				absolutePosition: {
					x: -450,
					y: -300
				}
			}
		},
		header: {
			margin: [30, 40, 40, 20],
			columns: [{
					image: getLogoBase64(),
					width: 120
				},
				{
					text: 'Relatório de Atendimentos XML',
					fontSize: 20,
					bold: true,
					alignment: 'center',
					margin: [0, 15],
					width: '*'
				},
				{
					text: new Date().toLocaleString(),
					alignment: 'right',
					width: 60
				}
			]
		},
		content: [{
				margin: [0, 10],
				table: {
					body: [
						[{
							text: 'Solicitação',
							style: 'subheader'
						}],
						[{
							text: textoPainelSolicitacao,
						}]
					]
				},
				layout: 'noBorders'
			},
			{
				margin: [0, 10],
				table: {
					body: [
						[{
							text: 'Filtros Utilizados',
							style: 'subheader'
						}],
						[{
							table: {
								headerRows: 0,
								widths: ['*', 'auto'],
								body: [filtros]
							},
							layout: 'noBorders'
						}]
					]
				},
				layout: 'noBorders'
			},
			{
				margin: [0, 10, 0, 0],
				text: 'Resultados',
				style: 'subheader'
			},
		],
		styles: {
			header: {
				fontSize: 18,
				bold: true,
				margin: [0, 0, 0, 10]
			},
			subheader: {
				fontSize: 16,
				bold: true,
				margin: [0, 10, 0, 5]
			},
			tableHeader: {
				bold: true,
				fontSize: 13,
				color: '#000'
			},
			tableCell: {
				fontSize: 7
			}
		},
		defaultStyle: {
			fontSize: 10
		}
	}

	if (!isEmpty(organizarPorFiltro) && organizarPorFiltro.valores.length > 0) {
		organizarPorFiltro.valores.forEach(valor => {
			const dadosTabela = organizarDados(organizarPorFiltro.chave, valor, dados);
			pdf.content.push(
				criarTabelaTipoFiltro(organizarPorFiltro.nome, valor),
				criarTabelaResultados(dadosTabela)
			);
		});
	} else {
		pdf.content.push(criarTabelaResultados(dados));
	}

	return pdf;
}

/**
 * Função para verificar se a string é nula | vazia | indefinida
 * 
 * @param {string} value string a ser analisada 
 * 
 * @return {boolean} true: é vazio, false: não vazio
 */
function isEmpty(value) {
	if (value === null ||
		value === '' ||
		typeof value === 'undefined' ||
		value.length === 0 ||
		value === [''])
		return true;

	return false;
}

function converterDataParaBr(data) {
	const aux = data.split('-');
	return aux[2] + '/' + aux[1] + '/' + aux[0];
}

function organizarDados(chave, valor, dados) {
	const resultado = [];

	dados.forEach(dado => {
		if (chave === 'status') {
			if (valor === 'Em andamento') {
				if (dado['emAndamento'] === 'Sim') resultado.push(dado);
			} else if (valor === 'Finalizado') {
				if (dado['contabil'] === 'Sim') resultado.push(dado);
			}
		} else if (chave === 'demanda') {
			if (dado['tipoDemanda'].indexOf(valor) != -1) resultado.push(dado);
		} else {
			if (dado[chave] === valor) resultado.push(dado);
		}
	});

	return resultado;
}

